import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
@Component({
  selector: 'app-add-faq',
  templateUrl: './add-faq.page.html',
  styleUrls: ['./add-faq.page.scss'],
})
export class AddFAQPage implements OnInit {

  constructor(private router:Router) { }

  ngOnInit() {
  }

  goBack(){
    this.router.navigate(['/folder/Admin Panel']);
  }
}
<ion-header [translucent]="true">
  <ion-toolbar >
    <ion-buttons slot="start">
      <ion-button  (click)="goBack()" class="custom-button" expand="block"><ion-icon name="chevron-back-outline" slot="start"></ion-icon></ion-button>
    </ion-buttons>
    <ion-title>Medical FAQs</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="gradient-background">
  <ion-header>
    <ion-toolbar class="header-background">
      <ion-title></ion-title>
    </ion-toolbar>
  </ion-header>

  <div id="container">
    <strong class="capitalize">Add Useful Medical FAQs</strong>
    <p>This can help members know what to do during emergencies</p>

    <ion-card>

      <ion-card-content>
        <ion-item>
          <ion-icon name="help-outline" slot="start"></ion-icon>
          <ion-input label="Write the FAQ" labelPlacement="stacked" placeholder="Question..."  class="custom-input"></ion-input>
        </ion-item>

      </ion-card-content>

    </ion-card>
  </div>




 </ion-content>
